INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 401, 10046, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24001, 0.0, "アヤネ", 2, 0.0, 102301, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 402, 10046, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24002, 2.21, "アヤネ", 1, 0.0, 102301, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 403, 10046, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24003, 0.0, "アヤネ", 2, 0.0, 102301, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 701, 10046, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24004, 1.99, "アサヒ", 2, 0.0, 192201, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 702, 10046, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24005, 2.21, "アサヒ", 1, 0.0, 192201, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 703, 10046, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24006, 3.33, "アサヒ", 2, 0.0, 192201, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 801, 10046, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24007, 0.0, "部員３", 2, 0.0, 192301, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 802, 10046, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24008, 2.68, "部員３", 1, 0.0, 192301, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 803, 10046, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24009, 0.0, "部員３", 2, 0.0, 192301, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 501, 10046, "やった！", 24010, 0.0, "", 1, 0.0, 192501, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 502, 10046, "勝ったよ！", 24011, 0.0, "", 1, 0.0, 192501, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 503, 10046, "いい調子！", 24012, 0.0, "", 1, 0.0, 192501, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 111, 10046, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24013, 5.33, "ミサト", 6, 0.0, 113501, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 112, 10046, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24014, 6.85, "ミサト", 1, 0.0, 113501, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 113, 10046, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24015, 3.0, "ミサト", 1, 0.0, 113501, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 611, 10046, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24016, 6.11, "ダイチ", 1, 0.0, 192401, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 612, 10046, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24017, 6.75, "ダイチ", 1, 0.0, 192401, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 613, 10046, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24018, 0.0, "ダイチ", 2, 0.0, 192401, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 211, 10046, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24019, 4.52, "ハツネ", 2, 0.0, 113401, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 212, 10046, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24020, 3.89, "ハツネ", 2, 0.0, 113401, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 213, 10046, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24021, 13.49, "ハツネ", 1, 0.0, 113401, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 311, 10046, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24022, 3.17, "カヤ", 1, 0.0, 106501, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 312, 10046, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24023, 4.42, "カヤ", 1, 0.0, 106501, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 313, 10046, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24024, 2.89, "カヤ", 6, 0.0, 106501, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 421, 10046, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24025, 3.71, "アヤネ", 4, 0.0, 102301, 24, "2030/12/17 14:59:59", 3, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 721, 10046, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24026, 5.1, "アサヒ", 2, 0.0, 192201, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 821, 10046, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24027, 4.34, "部員３", 1, 0.0, 192301, 24, "2030/12/17 14:59:59", 3, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 521, 10046, "いい勝負だったよ\nまたやろうね", 24028, 0.0, "", 1, 0.0, 192501, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 101, 10046, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24029, 5.62, "ミサト", 1, -360.0, 113501, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 102, 10046, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24030, 9.58, "ミサト", 1, -360.0, 113501, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 103, 10046, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24031, 0.0, "ミサト", 2, -360.0, 113501, 24, "2030/12/17 14:59:59", 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 104, 10046, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24032, 9.13, "ミサト", 2, -360.0, 113501, 24, "2030/12/17 14:59:59", 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("2020/07/31 12:00:00", 105, 10046, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24033, 8.27, "ミサト", 1, -360.0, 113501, 24, "2030/12/17 14:59:59", 2, 0.0);
